import React from "react";
import Topbar_Middle from "Topbar_Middle";
import "./App.css";
import { FaFacebook } from "react-icons/fa";
import { FaSearch } from "react-icons/fa";
import { SiAirplayvideo } from "react-icons/si";
import { FaHome } from "react-icons/fa";
import { SiMarketo } from "react-icons/fa";

function Topbar() {
  return (
    <div className="top-bar">
      {/* left side */}
      <div className="leftside">
        <FaFacebook className="fb-logo"></FaFacebook>
        <div className="searchdiv">
          <FaSearch></FaSearch>
          <input className="search" placeholder="Search Facebook"></input>
        </div>
      </div>

      {/* middle side */}
      <div>
        <Topbar_Middle ico></Topbar_Middle>
        <Topbar_Middle></Topbar_Middle>
        <Topbar_Middle></Topbar_Middle>
        <Topbar_Middle></Topbar_Middle>
        <Topbar_Middle></Topbar_Middle>
        <FaHome></FaHome>
        <SiAirplayvideo></SiAirplayvideo>
        <SiMarketo></SiMarketo>
      </div>
    </div>
  );
}

export default Topbar;
